pattern = "TCGTAGTAA"
text = ""
atMost = 5

#finds matching snippets allowing the specified amount of mismatches
def approximateMatch(text, pattern, atMost):
    matchingPatterns = []
    for i in range(0, len(text) - len(pattern) + 1):
        count = 0
        searchPat = text[i : i + (len(pattern))]
        
        #Counts the mismatches in the snippet
        for j in range(0, len(searchPat)):
            if searchPat[j] != pattern[j]:
                count = count + 1

        #Adds the snippet index to the list if mismatches is within allowed amount
        if count <= atMost:
            matchingPatterns.append(i)
    return matchingPatterns
output = approximateMatch(text, pattern, atMost)
print(' '.join(map(str, output)))
